import React, { Component } from 'react';
import './Styles/Navbar.css';
import Logo from './Images/logo.png'

class Navbar extends Component {
    scroll = (name) => {
        console.log(name);
    }
    render() {
        return (
            <div>
            <div>
                <img id="Logo" src={Logo} />
            </div> 
            <div id="Navbar">
                    <div id="NavLinks">
                        <span className="NavItem" onClick={this.scroll("Contact")}>Contact</span>
                        <span className="NavItem" >Images</span>
                        <span className="NavItem" onClick={this.scroll("Queries")}>Queries</span>
                        <span className="NavItem" onClick={this.scroll("Products")}>Products</span>
                        <span className="NavItem" onClick={this.scroll("About")}>About</span>
                    </div>
            </div>
            </div>
        );
    }
}

export default Navbar;
